import React from 'react';
import { Link } from 'react-router-dom';
import './App.css';

function App() {

  const st = {
    textDecoration: "none"
  }

  return (
    <div className="nav_bar">
      <span>KeidaKira</span>
      <Link to='/login' style={st}>
        <li>Login</li>
      </Link>
      <Link to='/signup'>
        <li>Signup</li>
      </Link>
    </div>
  );
}

export default App;
